def generate_permutation(P16_byte, size):
    return [e * 4 + i for e in P16_byte for i in range(4)]

def initialize_mc_positions(IVLBC):
    s_boxes = IVLBC // 4
    positions = []
    for i in range(16):
        if i < 4:
            positions.append([e * 4 + (i % 4) for e in [1, 2, 3]])
        elif i < 8:
            positions.append([e * 4 + (i % 4) for e in [0, 2, 3]])
        elif i < 12:
            positions.append([e * 4 + (i % 4) for e in [0, 1, 3]])
        else:
            positions.append([e * 4 + (i % 4) for e in [0, 1, 2]])
    return positions

def potential_ID_lp(filename, IVLBC, ROUND, s_boxes, Perm, conv, IVLBC_MC_pos, in_diff_bin, out_diff_bin):
    try:
        with open(filename, 'w+') as opIVLBC:
            opIVLBC.write("Minimize\n 0\n")
            opIVLBC.write("Subject to\n")

            # Constraints for input differences
            for i in range(IVLBC):
                if i in [len(in_diff_bin) - 1 - idx for idx, bit in enumerate(in_diff_bin) if bit == "1"]:
                    opIVLBC.write(f"x0_{i} = 1\n")
                else:
                    opIVLBC.write(f"x0_{i} = 0\n")

            buf = ''
            for i in range(IVLBC):
                buf += f"x1_{i} - x0_{Perm[i]} = 0\n"
            opIVLBC.write(buf)
                    
            for j in range(IVLBC):
                buf = ''
                for p in IVLBC_MC_pos[15 - (j % 16)]:
                    buf += f" + 1 x{1}_{(15 - p) + int(j / 16) * 16}"
                buf += f" - 2 z{1}_{j} - x{2}_{j} = 0\n"
                opIVLBC.write(buf)

            # Constraints for each round
            for i in range(2, ROUND + 2):
                for j in range(s_boxes):
                    buf = ''
                    for k in range(21):
                        for l in range(9):
                            coff = conv[9 * k + l]
                            if coff > 0:
                                if l <= 3:
                                    buf = buf + " + " + str(coff) + " x" + str(i) + "_" + str(4 * j + 3 - l)
                                if 4 <= l and l <= 7:
                                    buf = buf + " + " + str(coff) + " y" + str(i) + "_" + str(Perm[4 * j + 7 - l])
                                if l == 8:
                                    buf = buf + " >= -" + str(coff) + "\n"
                            if coff < 0:
                                if l <=  3:
                                    buf = buf + " - " + str(-coff) + " x" + str(i) + "_" + str(4 * j + 3 - l)
                                if 4 <= l and l <= 7:
                                    buf = buf + " - " + str(-coff) + " y" + str(i) + "_" + str(Perm[4 * j + 7 - l])
                                if l == 8:
                                    buf = buf + " >= " + str(-coff) + "\n"
                            if coff == 0:
                                if l == 8:
                                    buf = buf + " >= " + str(coff) + "\n"
                    opIVLBC.write(buf)

                # Constraints for differences
                for j in range(IVLBC):
                    buf = ''
                    for p in IVLBC_MC_pos[15 - (j % 16)]:
                        buf += f" + 1 y{i}_{(15 - p) + int(j / 16) * 16}"
                    buf += f" - 2 z{i}_{j} - x{i + 1}_{j} = 0\n"
                    opIVLBC.write(buf)

            buf = ''
            for i in range(IVLBC):
                buf += f"x{ROUND + 3}_{i} - x{ROUND + 2}_{Perm[i]} = 0\n"
            opIVLBC.write(buf)

            
            # Constraints for output differences
            for i in range(IVLBC):
                if i in [len(out_diff_bin) - 1 - idx for idx, bit in enumerate(out_diff_bin) if bit == "1"]:
                    opIVLBC.write(f"x{ROUND + 3}_{i} = 1\n")
                else:
                    opIVLBC.write(f"x{ROUND + 3}_{i} = 0\n")

            # Variable definitions
            opIVLBC.write("Binary\n")
            for i in range(ROUND + 4):
                for j in range(IVLBC):
                    opIVLBC.write(f"x{i}_{j}\n")
            for i in range(2, ROUND + 2):
                for j in range(IVLBC):
                    opIVLBC.write(f"y{i}_{j}\n")
            opIVLBC.write("Integer\n")
            for i in range(1, ROUND + 2):
                for j in range(IVLBC):
                    opIVLBC.write(f"z{i}_{j}\n")
    except IOError as e:
        print(f"Error writing LP file: {e}")
        sys.exit(1)

def solve_lp_file(filename):
    """Solve the LP file using Gurobi and return the status."""
    try:
        model = read(filename)
        model.optimize()
        if model.status == GRB.OPTIMAL:
            return True
        elif model.status == GRB.INFEASIBLE:
            return False
        else:
            print(f"Solver stopped with status: {model.status}")
            return None
    except Exception as e:
        print(f"Error solving LP file: {e}")
        return None

